        {
            "section": "Free Shipping Availability",
            "parentSections": ["Free Shipping", "Domestic Shipping"],
            "answer": {
                "block": "<p>Our free shipping program is currently available to customers in the United States and with orders that have <span>eligible products, and subtotals, before taxes and any other shipping costs, of $49 or more</span>. Look for the Free Shipping <img class='smallImg' src='https://www.bodybuilding.com/images/help-pages/icons/freeShipTruck.png'/> icon to find eligible products.</p><p>If you have over $49 of eligible products in your cart, those will be shipped for free. Any product that is not eligible will be charged the Economy Shipping rate. Free Shipping also is only applied to orders of up to $500.</p><p><span>Note: </span>Free Shipping program is not available in Alaska, Hawaii, US Territories, or for Military Shipments.</p>"
            },
            "keywords": ["b-elite", "belite", "eligibility", "shipping", "shipping information"]
        },
        {
            "section": "Domestic Shipping Methods",
            "parentSections": ["Domestic Shipping"],
            "answer": {
                "block": "<p>We own and operate warehouses throughout the United States, so we can pack and ship your orders quickly. Partnerships with national and regional couriers allow us to offer several shipping options:</p><ul> <li><span>Economy:</span> Usually the least expensive option. Estimated delivery date is displayed during checkout and is based on your shipping address. Monday through Friday delivery only.</li><li><span>Standard:</span> Usually the best option for heavy shipments, such as large tubs of protein. Delivery date is displayed during checkout and is based on your shipping address. Monday through Friday delivery only.</li><li><span>Two Business Day Delivery:</span> Orders must be placed Monday – Friday by 2:00 p.m. EST, and items must be in-stock at one of our U.S. warehouses. Delivery date is displayed during checkout. Monday through Friday delivery only.</li><li><span>One Business Day Delivery:</span> Orders must be placed Monday – Friday by 2:00 p.m. EST, and items must be in-stock at one of our U.S. warehouses. Delivery date is displayed during checkout. Monday through Friday delivery only.</li><li><span>Military:</span> This is the only shipping option available for APO, FPO, or DPO military mailing addresses. Delivery date is displayed during checkout. Monday through Friday delivery only.</li></ul>"
            },
            "keywords": ["shipping methods", "united states"]
        },
        {
            "section": "Flat Rate Shipping",
            "parentSections": ["Domestic Shipping"],
            "answer": {
                "block": "<p>Our standard flat rate shipping program is currently available to customers in the United States and with orders that have eligible products, and subtotals, before taxes and any other shipping costs, of $49 or more. Look for the Free Shipping <img class='smallImg' src='https://www.bodybuilding.com/images/help-pages/icons/freeShipTruck.png'/> icon to find eligible products.</p><p>If you have over $49 of eligible products in your cart, customers have the ability to <span>upgrade, from free Economy shipping, to Standard shipping</span>, for a flat rate of $2.99. Any product that is not eligible will be charged the regular shipping rate. Flat rate shipping only applies to orders of up to $500.</p><p><span>Note:</span> Flat rate shipping is not available in Alaska, Hawaii, APO/FPO/DPO or U.S. Territories.</p>"
            },
            "keywords": ["shipping", "shipping information"]
        },
        {
            "section": "Military Shipping",
            "parentSections": ["Domestic Shipping"],
            "answer": {
                "block": "<p>We ship to all valid APO, FPO, or DPO military addresses. When placing your order, select the Military shipping option to help ensure your package arrives safely.<p>Due to heightened security, only limited tracking information is available on military orders and we are unable to track them after they leave the United States. Most military packages are delivered within 3-8 business days, however depending on location and other external factors, including military inspection, some orders may experience additional delays.<p>When shipping to an APO, FPO, or DPO address, please use the following format when completing your shipping address:<p>Example:<ul><li>John Smith<li>Address Line 1<li>Address Line 2 (if needed)<li>APO, AP 91645-<span>0000</span> (ZIP code for your location)<li>USA</ul><p><span>Note: The 4-digit ZIP code extension is required for all military addresses.</span> Please make sure to enter this extension when placing your order to help ensure your package arrives as quickly as possible.<p>There is no need to enter the actual city, state, or country where you are located. Enter APO, DPO, or FPO for the city and AA, AP, or AE for the state.</p>"
            },
            "keywords": ["base", "military", "shipping", "shipping information"]
        },
        {
            "section": "P.O. Boxes",
            "parentSections": ["Domestic Shipping"],
            "answer": {
                "block": "<p>We ship to P.O. Boxes with no problem. When you enter your shipping address, our system automatically selects the correct shipping option to get your order delivered directly to the Post Office box specified.</p>"
            },
            "keywords": ["po", "po boxes", "box", "usps", "postal service", "post office", "shipping", "shipping information"]
        },
        {
            "section": "Shipping Rates",
            "parentSections": ["Domestic Shipping", "International Shipping"],
            "answer": {
                "block": "<p>Shipping rates vary depending on the method selected and the weight of the order. To calculate the exact cost of shipping for your order, place the items you'd like to order in your shopping cart, and the estimated shipping rates are automatically calculated and updated each time an item or quantity is added.</p><p>If you are within the United States and are wondering about our Free Shipping program, please see the <a>Free Shipping</a> section of the Help Center for more information.</p>"
            },
            "keywords": ["shipping costs", "shipping cost", "freight", "freight costs", "shipping", "shipping information"]
        },
        {
            "section": "Countries We Ship To",
            "parentSections": ["International Shipping"],
            "answer": {
                "block": "<p>We are constantly striving to accommodate all international customers and make their purchase experience with Bodybuilding.com simple, safe, and professional. If you'd like to change your country store or see which one you are currently in, please follow the instructions below:</p><p><span>From Website</span></p><p>To access your country specific store on the Bodybuilding.com website, do the following:</p><ol> <li>Click Store at the top of the page.</li><li>At the very top of the page above the Bodybuilding.com logo, click the picture of the United States flag.</li><li>Select your country from the Quick Links section, or select the first letter of your country, and then select your country from the list.</li></ol><p><span>Store App</span></p><p>To access your country specific store using our mobile Store application, do the following:</p><ol><li>Tap My Account at the bottom of the screen.</li><li>Tap Change Country.</li><li>Select your country from the options listed, or tap Select Your Country for more options, select the first letter of your country, and then select your country from the list.</li></ol><p>If your country is not listed, then unfortunately we are unable to ship to you at this time. In some cases, we are restricted by U.S. State Department regulations, and in other cases, we cannot ship to certain countries for other business related reasons.</p><p><span>Note:</span> For customers in the U.S. military, we ship to all APO, FPO, and DPO addresses regardless of country, see our <a>Military Shipping</a> section for more information.</p>"
            },
            "keywords": ["restrictions", "shipping", "shipping information"]
        },
        {
            "section": "Delays and Customs",
            "parentSections": ["International Shipping"],
            "answer": {
                "block": "<p>Unfortunately, due to circumstances outside of our control, some international orders are stopped by the customs agency in your country.<p>Please also read our full disclaimer:<h3>DISCLAIMER:</h3><p>\"We cannot be responsible for any customs restrictions, tariffs, or other regulations that may apply at Customs in any country. Any duties or taxes that may apply are your responsibility. If you have any questions, we encourage you to speak with your customs office, although we will ship any products you order to the address you provide.<p>Since the laws are different in every country (and change often), we maintain an extensive database of known product restrictions. To make ordering easier for you, your country store and the shopping cart will enforce these known restrictions to prevent you from accidentally ordering a product we know to have issues with your customs department. The responsibility is yours to check with your country's customs office to verify that your products can clear customs.<p>We will do our part and follow the exact directions in your order. We will ship your order to the exact address that you provide. Please keep in mind that once an order has shipped, we cannot change the address information on an international order, and errors here could cause a delivery delay or rejection. We will give you the best service and ship it very quickly at the rates that we have agreed to on our site - you pay actual shipping charges based on the weight of the package. If for whatever reason the package is seized by Customs officials, we will not issue you a refund unless all products are returned to us in their original condition. The vast majority of orders make it through customs without any problems, and most orders that are stopped are automatically returned to us. You may be responsible for any return shipping charges, in accordance with your local regulations.\"<p>By ordering from Bodybuilding.com, you are stating that you agree to the above disclaimer. While we rarely have problems with international shipments, if there is a problem with your order, we will work hard to find a solution as quickly as possible.<p><span>Note:</span> International customers are responsible for ensuring that the products ordered can be lawfully imported to your country. When ordering from Bodybuilding.com, the recipient is the importer of record and must comply with all laws and regulations of the destination country. Orders shipped to countries outside of the United States may be subject to import taxes and customs duties levied by the destination country once a shipment enters the country. From our experience, most foreign customers are not charged when they receive the shipment, however, any additional charges for customs clearance must be paid by the recipient. Customs policies vary widely from country to country and we recommend contacting your local customs office for further information. If you do get charged an additional fee, the carrier will expect payment at the time of delivery. If you refuse the shipment because of these charges, or if an order is rejected by customs due to item restrictions, or if the order is returned because the local post is unable to locate your address, we can refund you for the cost of the products (which does not include any shipping or return shipping fees) once the package is returned and processed by our warehouse. Please note that packages returned by customs can sometimes take a very long time to return, and in extreme circumstances can take as long as one year."
            },
            "keywords": ["delayed", "stuck", "borders","shipping", "shipping information"]
        },
        {
            "section": "Duties and Taxes",
            "parentSections": ["International Shipping"],
            "answer": {
                "block": "<p>Duties and taxes are different in every country and many factors play a role in determining if they need to be paid. Orders shipped to countries outside of the United States may be subject to import taxes and customs duties levied by the destination country. From our experience, most foreign customers are not charged when they receive the shipment, however, any additional charges for customs clearance must be paid by the recipient. Customs policies vary widely from country to country and we recommend contacting your local customs office for further information.<p>If you do get charged an additional fee, the carrier will expect payment at the time of delivery. If you refuse the shipment because of these charges, or if an order is rejected by customs due to item restrictions, or if the order is returned because the local post is unable to locate your address, we can refund you for the cost of the products (which does not include any shipping or return shipping fees) once the package is returned and processed by our warehouse. Please note that packages returned by customs can sometimes take a very long time to return, and in extreme circumstances can take as long as one year.</p><p>In accordance with the laws governing members of the E.U., Bodybuilding.com is obligated to charge Value Added Tax (VAT) on all orders delivered to some EU member states. We currently service the following countries in the European Union and work hard to provide quick and cheap delivery options:</p><ul><li>Austria**<li>Finland</li><li>Italy<li>Poland**<li>Sweden**<li>Belgium<li>France**<li>Latvia**<li>Portugal**<li>United Kingdom*<li>Bulgaria**<li>Germany<li>Lithuania**<li>Romania**<li>Czech Republic**<li>Greece<li>Luxembourg**<li>Slovakia**<li>Denmark**<li>Hungary**<li>Malta<li>Slovenia**<li>Estonia**<li>Ireland**<li>Italy**<li>Netherlands</li><li>Spain</ul><p>*VAT included in the price of products<br>**VAT calculated and displayed at checkout<p>In accordance with the laws governing members of the E.U., Bodybuilding.com is obligated to charge Value Added Tax (VAT) on all orders delivered to some E.U. member states.<p>In Canada, tax is charged on all sales and is listed separately in the cart so you know exactly what charges are associated with your purchase. Many factors can change between the time you place an order and the time your order is shipped, which could affect the calculation of taxes. Therefore, the amount appearing on your order as 'Estimated Tax' can differ from the taxes ultimately charged when your order ships.</p>"
            },
            "keywords": ["taxed", "duty", "shipping", "shipping information"]
        },
        {
            "section": "International Shipping Methods",
            "parentSections": ["International Shipping"],
            "answer": {
                "block": "<p>We have worked hard to find the best shipping methods possible for our international customers. Many factors play a role in the time it takes for an international shipment to arrive at your door, but we do everything we can to help ensure these times are as quick as possible.</p><p>If you are in Australia, Brazil, Canada, the EU, or the UK, please see below for your countries shipping section in the Help Center.</p><ul> <li><a>Shipping to Australia</a></li><li><a>Shipping to Brazil</a></li><li><a>Shipping to Canada</a></li><li><a>Shipping to the European Union</a></li><li><a>Shipping to the UK</a></li></ul><p>For all other countries, when placing an order, you can select from the following shipping options:</p><p><span>Standard Delivery (10 - 25 Business Days*):</span> This service is very popular for smaller, lighter packages with orders delivered by the local mail service. Unfortunately, tracking numbers may not be available to customers on packages sent using this shipping method.</p><p><span>Economy (5 - 10 Business Days*):</span> For even faster delivery, international customers can select the Economy shipping method, which speeds delivery and includes step-by-step tracking information, allowing you to follow the progress of your order all the way to your front door.</p><p><span>Priority (2 - 6 Business Days*):</span> Priority shipping is the fastest method available to international customers. Shipping times are incredibly fast, with most orders arriving at your country's customs agency very quickly. Priority also offers more tracking visibility, which allows you to check the status on your order at any time.</p><p>*Not all shipping methods are available in all countries and times given are an average for international delivery. Actual shipping time to your country's customs agency may vary and a more specific time frame for your country will be provided during the checkout process. When customs clearance procedures are required, it can cause delays beyond our original delivery estimates.</p><p><span>Note:</span> International customers are responsible for ensuring that the products ordered can be lawfully imported to your country. When ordering from Bodybuilding.com, the recipient is the importer of record and must comply with all laws and regulations of the destination country. Orders shipped to countries outside of the United States may be subject to import taxes and customs duties levied by the destination country once a shipment enters the country. From our experience, most foreign customers are not charged when they receive the shipment, however, any additional charges for customs clearance must be paid by the recipient. Customs policies vary widely from country to country and we recommend contacting your local customs office for further information. If you do get charged an additional fee, the carrier will expect payment at the time of delivery. If you refuse the shipment because of these charges, or if an order is rejected by customs due to item restrictions, or if the order is returned because the local post is unable to locate your address, we can refund you for the cost of the products (which does not include any shipping or return shipping fees) once the package is returned and processed by our warehouse. Please note that packages returned by customs can sometimes take a very long time to return, and in extreme circumstances can take as long as one year.</p><p>No matter which shipping option you choose, our award winning customer service team is here to help you with your shipment and make sure it arrives to you quickly and safely.</p>"
