r will expect payment at the time of delivery. If you refuse the shipment because of these charges, or if an order is rejected by customs due to item restrictions, or if the order is returned because the local post is unable to locate your address, we can refund you for the cost of the products (which does not include any shipping or return shipping fees) once the package is returned and processed by our warehouse. Please note that packages returned by customs can sometimes take a very long time to return, and in extreme circumstances can take as long as one year.</p>"
