                "block": "<h3>Previously Downloaded Free Apps</h3><p>If you downloaded a free Bodybuilding.com fitness plan app, you will no longer have access to its content. You must subscribe to All Access in order to use the app.</p><h3>Previously Purchased Free Apps</h3><p>If you purchased your Bodybuilding.com fitness plan app, that app and its content is yours as long as you like.</p><p>Your previously downloaded Bodybuilding.com fitness app does not grant you access to the All Access program but rather only the content within the app you purchased. You must subscribe to All Access in order to enjoy other fitness plans.</p><h3>Purchasing All Access Subscription Through Apps</h3><p>You can sign up for All Access directly through any Bodybuilding.com fitness plan app (excluding the BodySpace application) using the payment method associated with your iTunes or Google Play account. All subscriptions and auto-renewing charges purchased through a Bodybuilding.com fitness plan application will be managed through your Google Play or iTunes account.</p><p><span>If you have any other questions about All Access, please feel free to contact us at <a href='tel:1-833-649-9634'>1-833-649-9634</a> Domestically or <a href='tel:1-208-489-6056‬'>1-208-489-6056‬</a>Internationally, or by email at <a href='mailto:allaccess@bodybuilding.com'>allaccess@bodybuilding.com</a>, and we'll be happy to help you.</span></p>"
