        {
            "section": "All Access Purchase Details",
            "parentSections": ["All Access"],
            "answer": {
                "block": "<h3>When will I be billed?</h3><p>You will be billed on the day you sign up, then monthly or annually on the date of original purchase. For example, a monthly subscription purchased on January 14 will be auto renewed February 14, March 14, etc. An annual subscription purchased on January 14 will be auto renewed on the following January 14. If a subscription is purchased on the 29th, 30th or 31st, then the renewal will happen on the last day of the month for those months that don't have those days. The renewal should revert back to the purchase day after that.</p><h3>All Access Costs</h3><p>Prices for All Access are as follows:</p><ul> <li>$8.99 per month</li><li>$89.99 per year (Two months free!)</li></ul><h3>Using In-Store credit for All Access</h3><p>You cannot purchase All Access with in-store credit. Your All Access subscription will require a valid credit card for auto renewal.</p><h3>All Access Promotions</h3><p>Only promotions specifically for All Access can be applied to the cost of the membership. Other promotions that can be used in the store cannot be applied to the purchase of an All Access subscription.</p><h3>All Access Trial</h3><p>We do not offer a free trial period, but try out this pared down version of our fitness plans. It's simple for you to jump in, give it a try, and consider before signing up for All Access.</p><a href=fun/new-year-start-here-7-day-beginner-trainer.html>7-Day Beginner Trainer</a><h3>All Access Sales Tax</h3><p>You will be charged sales tax based on the credit card billing address associated with your subscription purchase and auto renewals.</p><h3>International Membership Purchase</h3><p>If you live outside of the United States, you can easily get an All Access membership. You may see the amount converted in your cart, but you will be charged the amount by us in USD.</p><p><span>If you have any other questions about All Access, please feel free to contact us at <a href='tel:1-833-649-9634'>1-833-649-9634</a> Domestically or <a href='tel:1-208-489-6056‬'>1-208-489-6056‬</a>Internationally, or by email at <a href='mailto:allaccess@bodybuilding.com'>allaccess@bodybuilding.com</a>, and we'll be happy to help you.</span></p>"
            },
            "keywords": ["charged"]
        },
        {
            "section": "Managing All Access Subscription",
            "parentSections": ["All Access"],
            "answer": {
                "block": "<h3>Skipping All Access Months</h3><p>Currently, this featured is not available at this time. Annual All Access subscriptions will run for twelve consecutive months from your date of purchase. If you need to cancel your subscription, please see our cancelation policy below.</p><h3>Cancelling All Access Subscription</h3><p>If you purchased your All Access subscription directly from Bodybuilding.com's website, please log in to you Bodybuilding.com Account and choose Manage Subscription from your <a href='store/account/'>My Account</a> page. Here you will be able to cancel your All Access subscription. You can also contact our Customer Service team for assistance.</p><p>If you purchased an All Access subscription through Google Play or iTunes, please reference the subscription policies of Google Play and iTunes directly, as your subscription is managed directly through the app store and not your Bodybuilding.com account.</p><h3>All Access Refunds</h3><p>We currently cannot provide a refund for All Access. If you cancel, your subscription will remain active for the duration of the subscription period you purchased.</p><h3>Viewing and editing All Access Account and Billing Information</h3><p>If you purchased your All Access subscription directly from Bodybuilding.com's website, please log in and choose Manage Subscription from your <a href='store/account/'>My Account</a> page. It will have all the information about your All Access purchase, payment method, and renewal transactions. Alternatively, if you purchased your All Access subscription from Google Play or iTunes, your subscriptions will be managed through your Google Play or iTunes account used to purchase your All Access subscription.</p><p><span>If you have any other questions about All Access, please feel free to contact us at <a href='tel:1-833-649-9634'>1-833-649-9634</a> Domestically or <a href='tel:1-208-489-6056‬'>1-208-489-6056‬</a>Internationally, or by email at <a href='mailto:allaccess@bodybuilding.com'>allaccess@bodybuilding.com</a>, and we'll be happy to help you.</span></p>"
