        {
            "section": "Returns",
            "parentSections": ["Order Inquiries"],
            "answer": {
                "block": "<h3>OUR MONEY-BACK GUARANTEE</h3><p>At Bodybuilding.com, we want you to be happy with your purchase! If you’re not satisfied, we’re not satisfied. If you’re unhappy with your order, whatever the reason may be, we’ll make it right. Contact our Customer Service team within 90 days of your purchase and we’ll either give you a full refund or in-store credit equal to the value of your product.</p><p><span>Clearance Items:</span> All clearance items are final sale and may not be returned. No price adjustments will be given on prior sales.</p>"
