        },
        {
            "section": "Order Status",
            "parentSections": ["Order Inquiries", "International Shipping", "Domestic Shipping"],
            "answer": {
                "block": "<h2>Domestic Packages</h2><h3>Tracking an Order</h3><p>When you place an order, the details are sent to our warehouses for shipment. As soon as the shipping label has been generated, you will receive an email with the tracking details. Tracking details can take up to 24 hours to update within the United States. You can also view the tracking details of the order at the <a href='store/account/order-history'>Order History</a> section of your My Account page.</p><p>If your order's tracking does not update after 24 hours, please contact us for further assistance.<span> Also, keep in mind that while our warehouses are open seven days a week, our couriers only pick-up packages between Monday – Friday.</span></p><p>If your package's tracking shows any errors, please contact us as soon as possible so we can get them taken care of for you. Please see the <a>Domestic Shipping</a> section for more detailed information about shipping domestically.</p><h2>International Packages</h2><h3>Tracking an Order</h3><p>When you place an order, the details are sent to our warehouses for shipment. As soon as the shipping label has been generated, you will receive an email with the tracking details. You can also view the tracking details of the order at the <a href='store/commerce/orderstatus.jsp?nl=true'>Order Status</a> section of out site.</p><p><span>Please note that it may take between 3-8 business days (Monday – Friday) for any initial tracking updates to appear.</span> This is because your order must pass through a major shipping hub before the online tracking system is updated. Nearly every international package we ship will pass through a major international sorting hub located in Frankfurt, Germany, before being forwarded to the destination country. This is not a cause for alarm if you see this information, your package will be leaving Germany very soon and the tracking will be updated again as it has reached your country's customs agency for clearance inspections.</p><h3>Timeframes</h3><p>Generally packages arrive in a very quick timeframe. In our experience, most packages reach customs within about 6-10 business days. Once your package has reached your government's customs agency, it must undergo clearance inspections. We do our best to speed-up this process by providing all of the required paperwork, but we are not able to determine exactly how long this will take for your order. Most of the time, packages are cleared within 5-7 business days and then handed-off to a local courier to complete delivery to you. Unfortunately, there is nothing we can do to speed this process.</p><p>Feel free to contact us if you feel your package is taking a unusually long time to reach you. Please see the <a>International Shipping</a> section for more detailed information about shipping internationally.</p>"
            },
            "keywords": [""]
        },
