        {
            "section": "Manage Friends",
            "parentSections": ["BodySpace"],
            "answer": {
                "block": "<p>Having friends with similar aspirations can make a big difference when it comes to accomplishing your own health and fitness goals.</p><h2>Adding Friends:</h2><p>You can add someone as a friend by going to the ‘Member Search' section of BodySpace.</p><h2>Removing Friends</h2><p>You can remove friends by logging in and going to your friends page. From there you can click on the friend button to remove a user from your friends list.</p>"
            },
            "keywords": ["friends list"]
        },
        {
            "section": "Setting Goals",
            "parentSections": ["BodySpace"],
            "answer": {
                "block": "<p>Setting a goal is a big step on the road to success. It helps you and everyone else on BodySpace see where you're going, and sets a deadline for getting there.</p><p>To set a goal on BodySpace, do the following:</p><ol> <li>Log in to BodySpace, hover over your profile picture at the top-right of the page, and then click <b>Goal</b>.</li><li>At the top of the page on the right side, click <b>Set Your Goal Now</b>.</li><li>Enter your current height, weight, and waist size, and then click <b>Next Step</b>.</li><li>Select a category for your goal, and then click <b>Next Step</b>.</li><li>Enter your current body fat %, or if you don't know it, click the <b>No, Help Me</b> button, and then click <b>Next Step</b>.</li><li>Select your goal physique from the options listed, and then click <b>Next Step</b>.</li><li>Adjust your calculated goal weight and body fat percentage if desired, and then click <b>Next Step</b>.</li><li>Select the amount of time you have consistently been lifting weights, and then click <b>Next Step</b>.</li><li>Adjust the intensity level you desire regarding the timeframe for reaching your goal, and then click <b>Next Step</b>.</li><li>Select options for how often you'd like BodySpace to remind you to update your weight and body fat statistics, and then click <b>Next Step</b>.</li><li>Click <b>Plan</b> to establish a plan for reaching your new goal, or click <b>Done</b> to do it later.</li></ol><p>Congratulations! You're well on your way to a new you! The deadline for reaching your goal is now listed on your Dashboard along with a status bar indicating the progress you've made so far. Be sure to create a plan for reaching your goal, track your completed workouts, and visit BodySpace often for extra motivation.</p><p>To edit a goal you've already set, go to the Goals page, click on the gear icon in the upper right corner of the Weight &amp; Body Fat Goals section, and then click Edit Goal.</p>"
            },
            "keywords": ["goal"]
        },
        {
            "section": "Tracking Workouts",
            "parentSections": ["BodySpace"],
            "answer": {
                "block": "<p>Tracking a workout and posting it to BodySpace can help you monitor progress, share workout plans with friends, and record details about each successful workout. Workouts can be entered as you go, saved as a template for future use, or shared with friends so they can use your routine to reach their own fitness goals.</p><p>To track a workout and post it to your BodySpace, do the following:</p><h3>On Desktop:</h3><ol> <li>Log in to BodySpace, hover over your profile picture at the top-right of the page, and then click <b>Track</b>.</li><li>On the right side of the page, click <b>Track Now</b>.</li><li>Select the template you'd like to use for entering the details about your workout. Options for templates to use include the following: <ul> <li>If you're tracking a workout using a previously created template, click <b>Workout Templates</b>, and then click <b>Track Now</b> next to the desired template.</li><li>If you're tracking a workout that you've logged previously, click <b>Workout Logs</b>, and then click <b>Track Now</b> next to the desired workout.</li><li>If you're tracking a new workout, click <b>Build As You Go</b>.</li></ul></li><li>Enter the date and time you started the workout, and then click <b>Next</b>.</li><li>Select the most accurate energy level for before you started the workout.</li><li>Select the location of your workout, and then click <b>Next</b>.</li><li>Enter your weight at the beginning of your workout, and then click <b>Next</b>. If you don't want to enter your weight during this step, click <b>Skip</b>.</li><li>Click <b>Start Adding Exercises</b>, type the name of the exercise in the Search field, and then click the <b>Search</b> button.</li><li>Click <b>Add Exercise</b> next to the desired one, enter the number of sets, and then click <b>Create</b>.</li><li>Enter the weight and number of reps for each set, and then enter the rest time between sets.</li><li>Enter the details for each set, which can include weight, the number of reps, or the length of time you performed the exercise, and then enter the rest time between sets.</li><li>If needed, enter notes at the bottom of the page, and then click either <b>Add an Exercise</b> or <b>I'm Finished With This Workout</b>.</li><li>Once you've completed your workout and have clicked <b>I'm Finished With This Workout</b>, enter the time you finished, and then click <b>Next</b>.</li><li>Rate your workout on a scale of 1 to 10, and then click <b>Next</b>.</li></ol><h3>On Mobile App:</h3><ol> <li>Launch the mobile application on your device, and then log in to your BodySpace profile.</li><li>Tap <b>Track A Workout</b>, and then select one of the following template options: <ul> <li>If you would like to use a saved template, tap <b>By Using a Saved Template</b>, select the desired template, and then tap <b>Track This Workout Now</b>.</li><li>If you would like to build a new template as you go, tap <b>Without Using a Template</b>.</li><li>If you would like to use a template you have used previously, tap <b>By Using a Previous Workout Log</b>, select the desired template, and then tap <b>Track This Workout Now</b>.</li></ul></li><li>Enter the date and time you started the workout, and then tap <b>Next</b>.</li><li>Select the location for the workout, and then tap <b>Next</b>.</li><li>Enter your weight at the beginning of the workout, and then tap <b>Next</b>.</li><li>Select your energy level at the beginning of the workout, and then tap <b>Next</b>.</li><li>Select the desired options for rest timers during your workout, and then tap <b>Next</b>.</li><li>Enter the details for each exercise, and when finished, tap <b>Done With Workout</b>.</li><li>Enter the time you finished your workout, and then tap <b>Next</b>.</li><li>Rate your workout performance, and then tap <b>Next</b>.</li><li>Tap <b>Next</b> to complete the workout, or <b>Edit</b> in the lower right corner to make changes to the workout.</li></ol>"
            },
            "keywords": ["tracking"]
        },
