        {
            "section": "Credit and Debit Cards",
            "parentSections": ["Payments and Refunds"],
            "answer": {
                "block": "<p>You can use the following credit cards on Bodybuilding.com:</p><ul><li>Visa</li><li>MasterCard</li><li>Discover</li><li>American Express</li><li>JCB</li></ul><p>When an order is submitted using a card payment, we authorize the amount with your bank, but no money is withdrawn from the account. While the funds may appear gone from your available balance, they have not entered our account, your bank has placed the funds on hold.</p><p>Once an order has shipped, the authorization becomes settled and the funds enter our account. If for some reason your order does not ship and the order is cancelled, it can take several days for your bank to release the funds back to your account.</p><p>If your card is declined we suggest verifying the card information and billing address was entered correctly and trying again. If the card is declined again, you may need to contact your credit card company or the issuing bank for more information.</p><p><span>Note:</span></p><p>To protect against fraud, orders that are suspected as fraudulent are canceled and payment is voided.</p><p>Discover and JCB cards are only available for domestic customers. For the safety and security of our customers, any international orders over $25,000 USD must be placed using a secure form of payment.</p>"
            },
            "keywords": [""]
        },
        {
            "section": "In Store Credit",
            "parentSections": ["Payments and Refunds"],
            "answer": {
                "block": "<h2>Checking Your Balance</h2><p>The easiest way to check your in-store credit balance is to log in to your account, and add an item to the cart. Your in-store credit balance will then be displayed in the cart near the total.</p><p>If you prefer, you can also contact our Customer Service department and one of our representatives will check your balance right away.</p><h2>Using Credit</h2><p>To use your in-store credit, log in and place the items you'd like to order in the cart. When you're logged in to your account, in-store credit displays at the bottom of the page next to the order total, and automatically applies towards the purchase.</p><ul><li>If you don't want to use the in-store credit on a purchase, log out of your account and place the order as a guest.</li></ul><h2>Missing A Credit?</h2><p>First, make sure you are logged in, as in-store credit is linked to your account. If you're an international customer and the in-store credit was issued in your local currency, the credit will only display when shopping in your country specific store. If this fails, feel free to contact us for further assistance.</p>"
            },
            "keywords": [""]
        },
        {
            "section": "PayPal",
            "parentSections": ["Payments and Refunds"],
            "answer": {
                "block": "<p>To pay using your PayPal account, choose the PayPal option during checkout, and then click the ‘Proceed to PayPal' button to continue to the PayPal website.</p><p><span>Note:</span> Bodybuilding.com does not accept eChecks through PayPal.</p><p>Restricted Product Notice: Due to PayPal restrictions, some items cannot be paid for using the PayPal service. In these situations, a message displays in the cart to prompt you to choose a different payment option for those products.</p>"
            },
            "keywords": [""]
        },
        {
            "section": "Payment Methods",
            "parentSections": ["Payments and Refunds"],
            "answer": {
                "block": "<h2>Accepted Methods</h2><p>We accept several different payment methods including:</p><ul><li>Amazon Pay</li><li>Credit Cards</li><ul><li>Visa</li><li>MasterCard</li><li>Discover</li><li>American Express</li><li>JCB</li></ul><li>Bodybuilding.com Gift Certificates</li><li>PayPal</li><li>Bank Wire Transfer</li><li>Money Order</li></ul><p>We do not accept cash or personal check payments.</p><p><span>Note:</span></p><ul><li>The bank wire transfer and money order options are not available for customers using our mobile Store app.</li><li>Money order, Discover cards, and JCB cards are only available for domestic customers.</li><li>For the safety and security of our customers, any international orders over $25,000 USD must be placed using a secure form of payment.</li></ul><p>Brazilian Customers: A few Brazilian banks currently block the use of credit cards on the Brazilian Bodybuilding.com site. If you are having problems using your credit card, please attempt to place your order again using the U.S. store.</p>"
