        {
            "section": "Refund Timeframes",
            "parentSections": ["Payments and Refunds"],
            "answer": {
                "block": "<p>If you have been issued a refund by us, the timeframe for it to arrive in your account can vary with many different factors, including payment method and location.</p><h2>Credit Cards</h2><p><u>Domestic Customers</u></p><p>Depending on your bank, refunds should post back to your account within 2-5 business days.</p><p><u>International Customers</u></p><p>Depending on your bank, refunds should post back to your account within 4-25 business days. If your refund still hasn't processed after 25 business days, please let us know so we can research the issue and get it corrected right away.</p><p><u>Pending Charges</u></p><p>When an order is placed with Bodybuilding.com, a pending authorization is obtained from your credit card company. It is not until the order is shipped from our warehouse that the final charges are processed with the credit card. If for any reason your order is canceled before it is shipped, the final confirmation charge will not occur and any pending authorizations will be voided from our system within 24 hours. This can take several days to drop from your statement depending on your bank and we have no control over this timeframe.</p><h2>PayPal</h2><p>Any refunds should post to your account within 2-5 business days.</p><h2>In-Store Credit</h2><p>If you've been issued an In-Store Credit the next time you place an order you'll automatically see an credit deduction in the cart. Please make sure you're logged into your account so the credit displays correctly.</p>"
