                "block": "<p>Under specific circumstances, we may require a secure form of payment, such as a bank wire transfer or a money order (domestic customers only).</p><p>When you're ready to order and would like to use a secure payment method, begin to check out and then choose the ‘Money Order/Wire Transfer' option on the billing page. Once you submit your order, you can send payment using one of the following options:</p><p><u>Bank Wire Transfer</u></p><p>To pay using a bank wire transfer, provide the following information to your bank to transfer the funds:</p><p>Bank Name: JPMorgan Chase Bank<br>201 South Main Street Suite 300<br>Salt Lake City, UT 84111<br>Account Name: Bodybuilding.com, LLC<br>Routing #: 021000021<br>Account: 626512243<br>Swift Code: CHASUS33</p><p><u>Money Order (Domestic Customers Only)</u></p><p>To pay using a money order, send it in U.S. dollars to Bodybuilding.com along with a printed copy of your invoice, and address the money order to:</p><p>Bodybuilding.com LLC<br>Dept # 880083<br>P.O. Box 29650<br>Phoenix, AZ 85038-9650<br>USA</p><p>Include your order number with your secure payment to help ensure the payment is applied to your order. It can take up to two weeks for funds from a secure payment to deposit to our account. After the payment is processed, it can take an additional 3-4 business days to apply the payment to your order and prepare it for shipment.</p>"
