                "block": "<p><span>Terms Last Updated:</span> October 30, 2017</p><p><b>THIS IS A SUBSCRIPTION SERVICE THAT AUTOMATICALLY RENEWS.</b> PLEASE READ THESE TERMS &amp; CONDITIONS CAREFULLY BEFORE COMPLETING A PURCHASE FOR THE BODYBUILDING.COM ALL ACCESS AUTO-RENEWING SUBSCRIPTION SERVICE. IF YOU SIGN UP FOR BODYBUILDING.COM ALL ACCESS, YOU MUST EXPRESSLY ACCEPT THESE TERMS, CONDITIONS, LIMITATIONS, AND REQUIREMENTS.</p><p>The following terms and conditions (\"Terms\") apply to your participation in the Bodybuilding.com All Access program. These Terms are between you and Vitalize, LLC d/b/a Bodybuilding.com and/or its affiliates (“Bodybuilding.com” or “us”) and govern our respective rights and obligations. The Terms, together with any additional applicable terms and conditions related to any promotional offers provided to you for use with the All Access program, constitute the entire agreement between you and Bodybuilding.com related to your All Access program membership.</p><p>Please note that your use of the Bodybuildling.com website and mobile applications and membership in the All Access program are also governed by other terms and conditions, including Bodybuilding.com's <a href=\"fun/disclaim.htm\">Terms of Use</a> and <a href=\"store/help/privacy-policy.htm\">Privacy Policy</a> as well as any other applicable terms, conditions, limitations, and requirements on the Bodybuilding.com website or mobile applications, all of which (as changed over time) are incorporated into these Terms.</p><p><span>Eligible Purchases</span></p><p>All Access membership benefits are limited to certain physical and digital products sold by Bodybuilding.com on the Bodybuilding.com website and mobile applications. The All Access program does not affect special product, order, handling fees, and/or taxes that may apply.</p><p></p><p><span>Other Limitations</span></p><ul><li>Bodybuilding.com may accept, refuse, or terminate membership in the All Access program at our sole discretion.</li><li>You may not transfer or assign your All Access membership or any All Access program benefits.</li><li>All Access program benefits cannot be used to access products purchased for the purpose of resale to others.</li><li>Bodybuilding.com may in its sole discretion add or remove All Access membership benefits during certain periods with notice to you.</li></ul><p></p><p><span>Monthly &amp; Annual Membership Fees</span></p><p>The monthly membership fee for the All Access program is $8.99 USD. You may also sign up for an annual membership, as opposed to the monthly membership, in which case the annual membership fee for the All Access program is $89.99 USD. Both the monthly and annual membership fee will be referred to in these terms as the “membership fee.” Bodybuilding.com reserves the right to charge and process any membership fees in US dollars. Bodybuilding.com may offer different membership terms to different clients, and the fees for membership may vary. Additionally, prices may vary based on exchange rates and your financial institution. Bodybuilding.com does not charge currency exchange fees, however, your financial institution may. Please consult with your financial institution for more information. The All Access membership fee is non-refundable except as expressly set forth below. Taxes may apply on the membership fee. At the time of your membership renewal, we may increase the monthly or annual membership fee in our sole discretion but with notice to you. If you do not want to accept the increased annual membership fee, you may cancel the renewal of your All Access membership.</p><p></p><p><span>Membership Termination, Non-Refundable Fee</span></p><p>The All Access monthly and annual membership fees are pre-paid in full on a monthly or annual basis, respectively, and are non-refundable once paid. There is no pro-rata refund if the membership is cancelled prior to the end of the term except if offered in our sole discretion. <span>IMPORTANT: YOUR SUBSCRIPTION TO THE BODYBUILDING.COM ALL ACCESS PROGRAM AUTOMATICALLY RENEWS UNLESS YOU CANCEL IN A TIMELY MANNER.</span></p><p></p><p><span>In-App Purchase of Memberships</span></p><p>If you purchase your membership through a Bodybuilding.com mobile application in either the Google Play Store or Apple App Store, in addition to these Terms, your membership will be governed by the applicable store's subscription terms. All in-app subscriptions will automatically renew until you choose to end them. In-app subscriptions cannot be managed via your Bodybuilding.com All Access account. All in-app subscriptions can be managed via your Google and/or Apple account settings. &nbsp;&nbsp;&nbsp;</p><p></p><p><span>Membership Auto-Renewal &amp; Cancellation</span></p><p>If you have elected to enroll in the monthly membership plan, your membership will automatically renew 1 month following your initial enrollment (“Monthly Renewal Date”) unless you notify us that you wish to cancel prior to your Monthly Renewal Date. Alternatively, if you have elected to enroll in the annual membership plan, your membership will automatically renew 12 months after the date of your initial enrollment (your “Annual Renewal Date”) unless you notify us that you wish to cancel prior to your Annual Renewal Date. Both the Monthly Renewal Date and Annual Renewal Date may be collectively referred to in these Terms as the “Renewal Date”. YOU MUST AFFIRMATIVELY CANCEL AUTO RENEW BY THE RENEWAL DATE OR YOUR MEMBERSHIP WILL AUTOMATICALLY RENEW. You will receive an email from Bodybuilding.com (sent to the email address we have on file) at least thirty (30) days prior to your Annual Renewal Date for annual membership fees and reminding you of your right to cancel and advising you of any changes to these Terms. Your initial membership date and Renewal Date are always available for viewing in your account settings.</p><p></p><p>IF YOU HAVE PROVIDED US WITH A VALID CREDIT CARD NUMBER OR AN ALTERNATE PAYMENT METHOD SAVED IN YOUR BODYBUILDING.COM ACCOUNT AND YOU HAVE NOT CANCELLED BY YOUR RENEWAL DATE, YOUR ALL ACCESS SUBSCRIPTION WILL BE AUTOMATICALLY PROCESSED ON OR SHORTLY AFTER YOUR RENEWAL DATE AND THE CARD OR APPLICABLE PAYMENT METHOD YOU PROVIDED TO US AT THE TIME OF YOUR INITIAL PURCHASE AND ENROLLMENT IN OUR PROGRAM WILL BE CHARGED.</p><p></p><p>IF YOU WISH TO CANCEL YOUR PARTICIPATION IN OUR ALL ACCESS AUTO RENEWAL PROGRAM, you may cancel your subscription auto renewal at any time before your Renewal Date by calling 1-866-236-8417, by sending an email to <a href=\"mailto:allaccess@bodybuilding.com\" target=\"_blank\">allaccess@bodybuilding.com</a>, or by going to the <a href=\"store/account\">My Account</a> page and selecting to cancel All Access auto renewal. If your membership was purchased through a Bodybuilding.com mobile application in either the Apple App Store or the Google Play Store, please refer to the applicable store's terms for subscription management and cancellation or adjust your membership preferences in your Google and/or Apple account settings you used to initially purchase the subscription. If you cancel, you will not be charged on your Renewal Date but your membership will continue until your Renewal Date.</p><p></p><p><span>Promotional Trial Memberships</span></p><p>Bodybuilding.com reserves the right to offer certain clients various trial or other promotional memberships in the Bodybuilding.com All Access program, which are subject to these Terms except as otherwise stated in the promotional offers. Trial members may at any time choose not to continue to paid membership at the end of the trial period. YOU MUST CANCEL YOUR TRIAL MEMBERSHIP PRIOR TO THE EXPIRATION OF THE TRIAL PERIOD TO AVOID BEING CHARGED AUTOMATICALLY FOR A FULL MEMBERSHIP WHICH WILL THEN BE SUBJECT TO AUTO-RENEWAL.</p><p></p><p><span>Agreement Changes</span></p><p>We may in our sole discretion change these Terms or any aspect of the All Access program that is found invalid, void, unenforceable, or for any reason. Any such change to these Terms will be posted on the Bodybuilding.com website and will be sent to you before your membership auto-renews. YOUR CONTINUED MEMBERSHIP AFTER WE CHANGE THESE TERMS CONSTITUTES YOUR ACCEPTANCE OF THE CHANGES. IF YOU DO NOT AGREE TO ANY CHANGES, YOU MUST CANCEL YOUR MEMBERSHIP.</p><p></p><p><span>Price Changes</span></p><p>When you purchase a subscription, you will initially be charged at the rate applicable at the time of your agreement to subscribe. If the price of the subscription increases later, Bodybuilding.com will notify you. The increase will apply to the next payment due from you after the notice, provided that you have been given at least ten (10) days' prior notice before the charge is made. If you are given less than ten (10) days' prior notice, the price increase will not apply until the payment after the next payment is due.</p><p></p><p><span>Termination by Bodybuilding.com</span></p><p>We may terminate or suspend your All Access membership in our sole discretion for any reason without notice. We will not give a refund for termination related to conduct that we determine, in our discretion, violates these Terms or any applicable law, involves fraud or misuse of the All Access program, or is harmful to our interests or to another user. Our failure to insist upon or enforce strict compliance with these Terms will not constitute a waiver of any of our rights.</p><p></p><p><span>Consent to Receive E-mails</span></p><p>By submitting an application for membership to the All Access program, you agree (or, if you are a minor, your parent or legal guardian must agree) to receive advertising, marketing materials, and other communications from Bodybuilding.com. By signing up to join the All Access program, you will automatically be subscribed to receive All Access program emails. You may unsubscribe from receiving marketing emails at any time by clicking the “unsubscribe” link contained in the email footer or by contacting our Customer Service department at <a href=\"mailto:allaccess@bodybuilding.com\" >allaccess@bodybuilding.com</a>&nbsp;or by calling 1-866-236-8417.</p><p></p><p><span>Limitation of Liability</span></p><p>IN ADDITION TO OTHER LIMITATIONS AND EXCLUSIONS IN BODYBUILDING.COM'S <a href=\"fun/disclaim.htm\">TERMS OF USE</a> AND <a>Conditions of Sale/a>, WE OR OUR DIRECTORS, OFFICERS, EMPLOYEES, AGENTS, SUBSIDIARIES, JOINT VENTURES, THIRD-PARTY SERVICE PROVIDERS, OR OTHER REPRESENTATIVES SHALL NOT BE LIABLE FOR ANY DIRECT, INDIRECT, SPECIAL, INCIDENTAL, CONSEQUENTIAL, OR PUNITIVE DAMAGES, OR ANY OTHER DAMAGES OF ANY KIND, ARISING OUT OF OR RELATED TO THE ALL ACCESS PROGRAM OR YOUR ALL ACCESS MEMBERSHIP. OUR TOTAL LIABILITY, WHETHER IN CONTRACT, WARRANTY, TORT (INCLUDING NEGLIGENCE), OR OTHERWISE, WILL NOT EXCEED THE AMOUNT OF THE LAST MEMBERSHIP FEE YOU PAID. THESE EXCLUSIONS AND LIMITATIONS OF LIABILITY WILL APPLY TO THE FULLEST EXTENT PERMITTED BY LAW AND WILL SURVIVE CANCELLATION OR TERMINATION OF YOUR ALL ACCESS MEMBERSHIP. CERTAIN STATE LAWS DO NOT ALLOW THE EXCLUSION OR LIMITATION OF CERTAIN DAMAGES. IF THESE LAWS APPLY TO YOU, SOME OR ALL OF THE ABOVE EXCLUSIONS OR LIMITATIONS MAY NOT APPLY TO YOU, AND YOU MIGHT HAVE ADDITIONAL RIGHTS.</p><p></p><p><span>Dispute Resolution</span></p><p>If a dispute should arise between you and Bodybuilding.com, we want to provide you with a resolution that is efficient and cost effective by using our customer service team. Almost all customer service disputes can be resolved to the customer's satisfaction by using our customer service, reachable by calling 1-866-236-8417 or by sending an email to <a href=\"mailto:allaccess@bodybuilding.com\" >allaccess@bodybuilding.com</a>.</p><p></p><p>If your dispute cannot be resolved using our customer service team, these Terms describe how we will proceed with the resolution of the dispute.</p><p></p><p><span>THE FOLLOWING PROVISIONS RELATE TO DISPUTES AND CLASS ACTIONS. IT IS IMPORTANT THAT YOU READ THESE PROVISIONS CAREFULLY BEFORE ACCEPTING THESE TERMS AND CONDITIONS.</span></p><p></p><p><span>Binding Arbitration</span></p><p>ANY CLAIM OR DISPUTE RELATING IN ANY WAY TO YOUR USE OF THE BODYBUILDING.COM ALL ACCESS PROGRAM OR THESE TERMS SHALL BE SUBMITTED TO CONFIDENTIAL ARBITRATION. ARBITRATION REMOVES YOUR RIGHT TO LITIGATE A CLAIM IN COURT OR TO HAVE A JURY TRIAL ON THAT CLAIM. OTHER RIGHTS THAT YOU WOULD HAVE IN COURT MAY NOT BE AVAILABLE IN ARBITRATION. <span>IT IS IMPORTANT THAT YOU READ THIS PROVISION CAREFULLY BEFORE ACCEPTING THESE TERMS.</span> The arbitration will be administered by the American Arbitration Association (“AAA”) under its then-current arbitration rules. If any AAA rule conflicts with these Terms, these Terms shall control. You can obtain procedures, rules, and fee information from the AAA at www.adr.org or 1-800-778-7879. Any participatory arbitration hearing that you attend shall take place in Boise, Idaho and Idaho law will apply during the arbitration. The judgment upon the award rendered by the arbitrator shall be final and binding and may be entered in any court of competent jurisdiction. Unless inconsistent with applicable law, each party shall bear the expense of their respective attorneys', experts' and witness fees, regardless of which party prevails in the arbitration.</p><p></p><p><span>No Class Actions</span></p><p>TO THE EXTENT ALLOWED BY LAW, WE EACH WAIVE ANY RIGHT TO PURSUE DISPUTES ON A CONSOLIDATED OR CLASSWIDE BASIS; THAT IS, TO EITHER JOIN A CLAIM WITH THE CLAIM OF ANY OTHER PERSON OR ENTITY, OR ASSERT A CLAIM IN A REPRESENTATIVE CAPACITY ON BEHALF OF ANYONE ELSE IN ANY LAWSUIT, ARBITRATION, OR OTHER PROCEEDING. YOU UNDERSTAND THAT BY AGREEING TO THIS CLASS ACTION WAIVER, YOU MAY ONLY BRING CLAIMS AGAINST BODYBUILDING.COM IN AN INDIVIDUAL CAPACITY AND NOT AS A PLAINTIFF OR CLASS MEMBER IN ANY PURPORTED CLASS ACTION OR REPRESENTATIVE PROCEEDING.</p><p></p>"
