en performing search engine marketing. Affiliates must direct traffic to their own landing page from within paid search. Affiliate shall not solicit or target users who access the Bodybuilding.com Site from your Site with any promotions or offerings of goods or services that compete with the goods or services that we offer; provided that the foregoing limitations will not prohibit you from soliciting or targeting a group of all, or substantially all, users who access your Site.</li><li><span>Linking to Bodybuilding.com</span>. Affiliates that use link shorteners must have their link shortening method approved by Bodybuilding.com before use. The following link shortening services are approved:<ul><li>Bitly</li><li>Goo.gl</li><li>T.co</li><li>TinyURL</li></ul>Beyond link shortening, any type of link cloaking is prohibited. Affiliates that fail to provide accurate referring domains upon request from Bodybuilding.com will be subject to commission reversal and removal from the Bodybuilding.com affiliate network.</li><li><span>Coupon/Deal Marketing</span>. Posting of non-affiliate order level coupons by affiliates is prohibited without prior written consent from Bodybuilding.com. Coupons and deals found on the Networks or those being promoted directly on a Bodybuilding.com product page or brand guide are allowed. User generated content that contains unauthorized coupon codes is not allowed to appear on any page where an affiliate link to Bodybuilding.com is present. Affiliates found promoting any unauthorized coupon codes will be subject to a reversal of ALL commissions for the given period.</li><li><span>Site Usage</span>. Affiliates are prohibited from using Bodybuilding.com's property, including, but not limited to, BodySpace, Bodybuilding.com's Forum, Bodybuilding.com's Facebook wall, Bodybuilding.com Supplement Reviews and Bodybuilding.com's Article Comments feature, to direct traffic to websites, Facebook page names, Facebook advertising campaigns, and Twitter accou