                "block": "<h2>BODYBUILDING.COM TERMS OF USE</h2><p>These Terms of Use (\"Terms\") govern all use of Bodybuilding.com (\"Bodybuilding.com\"). Bodybuilding.com includes bodybuilding.com, bodyspace.bodybuilding.com, and other sites owned or operated (“Site”). By using and accessing the Site, you agree to these Terms, the <a>Privacy Policy</a>, other policies, and all applicable laws and regulations. Customers in the EU are subject to the <a>EU Conditions of Use</a>.</p><p>If any Bodybuilding.com services have additional terms and conditions, privacy statements, or other policies (\"Separate Terms\"), then those Separate Terms shall apply in connection with your use of that Bodybuilding.com service. To the extent there is a direct conflict between the Separate Terms and these Terms, the Separate Terms shall govern. If you do not want to be bound by these Terms, do not use the Site.</p><p>Bodybuilding.com is primarily an online retailer of third-party brands and all product information is provided by the brand owner and is for information purposes only. Actual product packaging may contain different information than is displayed on our site. DO NOT RELY SOLELY ON THIS INFORMATION. ALWAYS READ LABELS, WARNINGS AND FOLLOW DIRECTIONS ON THE PRODUCT LABEL BEFORE USE. YOU HEREBY WAIVE ANY LIABILITY AGAINST BODYBUILDING.COM FOR INACCURACIES OR MISSTATEMENTS RELATED TO PRODUCTS MANUFACTURED BY THIRD PARTIES.</p><p>Bodybuilding.com reserves the right to suspend or terminate your account and your ability to use the Site or portion thereof for failure to comply with these Terms or any Separate Terms related to a service, for infringing copyright, or for any other reason.</p><ol> <li><h3>CHANGES IN TERMS</h3> <p>Bodybuilding.com has the sole right at any time and without prior notice to revise these Terms. Bodybuilding.com will post changes on the Site and it is your responsibility to review these Terms and any modifications.</p></li><li><h3>TERMINATION</h3> <p>Bodybuilding.com has the right at any time and without prior notice to terminate some or all of Bodybuilding.com services, any feature or portion thereof, or any products or services offered, and to terminate your right to access or use Bodybuilding.com services or any feature or portion thereof.</p></li><li><h3>COMPLIANCE WITH LAWS</h3> <p>You agree to comply with all applicable laws and regulations regarding your use of the Site. You must be at least 13 years old to use Bodybuilding.com. See the Children's Personal Information section of the <a>Privacy Policy</a>.</p></li><li><h3>CONTENT</h3> <p>The text, images, photographs, graphics, videos, logos, illustrations, descriptions, data, and other material on the Site, as well as the selection, assembly, and arrangement thereof, are referred to collectively as the \"Content\".</p><p>The Content may contain errors, omissions, or may be out of date. Bodybuilding.com may change, delete, or update Content at any time. The Content is provided for informational purposes only and is not binding on Bodybuilding.com.</p><p>All content, logos, graphics, pages, scripts, and service names included in or made available through any Site are subject to trade dress, trademarks, service marks, and/or copyright law and other laws that protect intellectual property in the U.S. and other countries. Bodybuilding.com's intellectual property may not be used without Bodybuilding.com's written permission. All other trademarks and service marks not owned by Bodybuilding.com that appear in any Site are the property of their respective owners, who may or may not be affiliated with, connected to, or sponsored by Bodybuilding.com.</p><p>You may view and use the Content for your personal information and for ordering and for no other purpose. Bodybuilding.com does not grant to you or any person any right to use, reproduce, copy, modify, transmit, display, publish, sell, license, create derivative works, publicly perform, or distribute by any means, method, or process whatsoever, now known or hereafter developed, any of the Content on or transmitted through the Site.</p></li><li><h3>NOTICE AND PROCEDURE FOR ADDRESSING INTELLECTUAL PROPERTY CONCERNS</h3> <p>If you have any concerns related to intellectual property on the site, please provide the Bodybuilding.com copyright agent the following:</p><ul> <li>An electronic or physical signature of the person authorized to act on behalf of the owner of the copyright or other intellectual property interest;</li><li>A description of the copyrighted work or other intellectual property at issue;</li><li>The location of the material giving rise to the concern on the Site;</li><li>Your address, telephone number, facsimile number, and email address;</li><li>A statement by you that you have a good faith belief that the disputed use is not authorized by the copyright or other intellectual property owner, its agent, or the law;</li><li>A statement by you, under penalty of perjury, that the above information in your Notice is accurate and that you are the copyright or other intellectual property owner or are authorized to act on behalf of the copyright or other intellectual property owner.</li></ul> <p>Notification should be sent to:</p><p>Designated Agent: Bill Carter, Chief Legal Officer, 5777 N Meeker Ave, Boise, Idaho 83713, USA; +1 (208) 377-3326; <a href='mailto:legal@bodybuilding.com'>legal@bodybuilding.com</a></p></li><li><h3>PRODUCT REVIEWS</h3> <p>Product reviews appearing on the Site are prepared by third-parties (including, but not limited to, review pages, message boards, forums, text files, chats, etc.). Bodybuilding.com has not determined whether a specific reviewer's experience is what an average or typical customer may expect to achieve.</p></li><li><h3>ACCOUNTS</h3> <p>Some services on the Site permit or require you to create an account to participate or to secure additional benefits. You agree to provide, maintain and update true, accurate, current and complete information about yourself as prompted by our registration processes. You shall not impersonate any person or entity or misrepresent your identity or affiliation with any person or entity, including using another person's username, password or other account information, or another person's name, likeness, voice, image or photograph. You also agree to promptly notify Bodybuilding.com at <a href='webmaster@bodybuilding.com'>webmaster@bodybuilding.com</a> of any unauthorized use of your username, password, other account information, or any other breach of security involving or relating to the Site.</p></li><li><h3>USER CONTENT</h3> <p>The Site allows you to post content, including, but not limited to, photos, reviews, ideas, suggestions, links, and other materials. Anything that you post or otherwise make available on or in connection with the Site is referred to as “User Content.” User Content is non-confidential, non-proprietary, and may be used by Bodybuilding.com, Bodybuilding.com vendors, or their affiliates for any purpose without further permission, consent, payment, or other consideration, unless prohibited by law. You agree that as a condition of permitting you to submit User Content, you grant Bodybuilding.com, Bodybuilding.com's affiliates, and any sub-licensees, subject to the Privacy Policy, a non-exclusive, irrevocable, royalty-free, worldwide, fully sub-licensable, perpetual right and license to use, copy, publicly perform, digitally perform, publicly display, and distribute User Content, including the use of your name, alias, and any other information (provided by you), and to prepare derivative works based on, or incorporate into other works, User Content, with or without attribution. You represent and warrant that any User Content is in compliance with all applicable laws and regulations, and it is not composed of and does not contain viruses, solicitations, or any form of spam. Your submission of User Content constitutes an agreement that you will defend, indemnify, and hold Bodybuilding.com harmless for all claims resulting from User Content you supply.</p><p>Bodybuilding.com is not responsible for, and does not endorse the opinions, advice or recommendations in User Content and specifically disclaim all liability in connection therewith.</p><p>Bodybuilding.com reserves the right to modify, review, delete and refuse to post User Content for any reason.</p></li><li><h3>PUBLIC FORUMS AND COMMUNICATION</h3> <p>\"Forum\" means an area, site or feature offered as part of a Site that allows users to distribute User Content for viewing by Site users, including a chat area, message board, messaging, social community environment, profile page, blog, and e-mail function.</p><p>You acknowledge that Forums and features offered therein are for public and not private communications, and you have no expectation of privacy with regard to any User Content. You further agree that your communications will comply with all rules set forth in section 10 below. Bodybuilding.com cannot guarantee the security of any User Content and you make such disclosures at your own risk. Bodybuilding.com has no duty to monitor any Forum.</p></li><li><h3>RULES OF CONDUCT</h3> <p>By using the Site, you agree that you will not submit any User Content that: (a) is defamatory, abusive, harassing, threatening, or an invasion of a right of privacy; (b) is bigoted, hateful, or racially or otherwise offensive; (c) is violent, vulgar, obscene, pornographic or otherwise sexually explicit; or (d) otherwise harms or can reasonably be expected to harm any person or entity; (e) is illegal or encourages or advocates illegal activity or the discussion of illegal activities with the intent to commit them, including User Content that is or represents an attempt to engage in child pornography, stalking, sexual assault, suicide, fraud, trafficking in obscene or stolen material, drug dealing and/or drug abuse, harassment, theft, or conspiracy to commit any criminal activity; (f) infringes or violates any right of a third party; (g) is commercial, business-related or advertises or offers to sell any products, services or otherwise (whether or not for profit), or solicits others (including solicitations for contributions or donations) unless specifically authorized by Bodybuilding.com; (h) contains a virus or other harmful component, or otherwise tampers with, impairs or damages the Site or any connected network, or otherwise interferes with any person or entity's use or enjoyment of the Site; (i) violates any specific restrictions applicable to a Forum, including its age restrictions and procedures; or (j) is antisocial, disruptive, or destructive, including flaming, spamming, flooding, trolling, and griefing as those terms are commonly understood and used on the internet.</p></li><li><h3>DISCLAIMER AND LIMITATION OF LIABILITY AS TO THE BODYBUILDING.COM.COM SITE AND CONTENT</h3> <p>UNLESS PROHIBITED BY APPLICABLE LAW, BODYBUILDING.COM MAKES NO WARRANTIES OR REPRESENTATIONS WHATSOEVER WITH RESPECT TO BODYBUILDING.COM, ANY LINKED SITE OR ITS CONTENT, INCLUDING THE AVAILABILITY OF ANY SITE OR THE CONTENT, INFORMATION, AND MATERIALS ON IT OR THE ACCURACY, COMPLETENESS, OR TIMELINESS OF THAT CONTENT, INFORMATION, AND MATERIALS. BODYBUILDING.COM ALSO DOES NOT WARRANT OR REPRESENT THAT YOUR ACCESS TO OR USE OF BODYBUILDING.COM OR ANY LINKED SITE WILL BE UNINTERRUPTED OR FREE OF ERRORS OR OMISSIONS, THAT DEFECTS WILL BE CORRECTED, OR THAT BODYBUILDING.COM OR ANY LINKED SITE IS FREE OF COMPUTER VIRUSES OR OTHER HARMFUL COMPONENTS. WITHOUT LIMITING THE FOREGOING, ALL CONTENT PROVIDED ON OR THROUGH BODYBUILDING.COM IS PROVIDED TO USERS \"AS IS,\" WITH NO WARRANTY OF ANY KIND, EITHER EXPRESS OR IMPLIED, INCLUDING WITHOUT LIMITATION IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE, TITLE, NON-INFRINGEMENT, SECURITY, OR ACCURACY. THE \"AS IS\" CONDITION OF CONTENT IS EXPRESSLY MADE A CONDITION OF ANY TRANSACTION ARISING THROUGH OR AS A RESULT OF THE BODYBUILDING.COM SERVICES.</p><p>UNLESS PROHIBITED BY APPLICABLE LAW, BODYBUILDING.COM SHALL NOT, UNDER ANY CIRCUMSTANCES, BE LIABLE TO YOU FOR ANY INDIRECT, INCIDENTAL, CONSEQUENTIAL, SPECIAL, OR EXEMPLARY DAMAGES ARISING OUT OF OR IN CONNECTION WITH USE OF THE APPLICATION, WHETHER BASED ON BREACH OF CONTRACT, BREACH OF WARRANTY, TORT (INCLUDING NEGLIGENCE, PRODUCT LIABILITY OR OTHERWISE), OR ANY OTHER PECUNIARY LOSS, WHETHER OR NOT BODYBUILDING.COM HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. UNDER NO CIRCUMSTANCES SHALL BODYBUILDING.COM BE LIABLE TO YOU FOR ANY AMOUNT.</p></li><li><h3>ELECTRONIC COMMUNICATION</h3> <p>By using the Site you consent to receive communications from Bodybuilding.com electronically. Bodybuilding.com will communicate with you by email or by posting notices on the Site. You agree that all notices, disclosures, agreements and other communications that Bodybuilding.com provides electronically satisfies any legal requirement that such communications be in writing.</p></li><li><h3>LINKED THIRD PARTY SITES</h3> <p>Links to other websites operated by third parties, including Bodybuilding.com vendors, do not constitute sponsorship, endorsement, or approval by Bodybuilding.com of the content, policies, or practices of such linked sites. Bodybuilding.com does not operate, control, or maintain linked sites and is not responsible for their availability, content, security, policies, or practices. Links to other sites are provided for your convenience and you access them at your own risk.</p></li><li><h3>PRICES; ORDERS</h3> <p>All purchases and orders are subject to the <a>Conditions of Sale</a>.</p><p>Suggested Retail Price (“SRP”) is provided by the manufacturer and is the manufacturer's representation of value. Sales may or may not be made at this price. This price does not necessarily represent the prevailing retail price in every community, and may not represent the price at which Bodybuilding.com sells the