ders over $49.00</li><li>Free flat rate economy shipping</li></ul> <p>Items that are not eligible for B-Elite shipping will be treated as a separate cart based on total product weight and a minimum shipping charge will apply. The shipping service option selected by customer will apply to the entire cart, and any shipping service option selected outside of economy will follow a standard shipping card rate. All purchases, including B-Elite brands, may be subject to applicable tax.</p></li><li><h3>TRANSPARENCY IN SUPPLY CHAIN DISCLOSURE</h3><p>The state of California requires the following disclosure statement as of January 1, 2012, pursuant to the \"Transparency in Supply Chain Act of 2010\".</p><p><a href='http://www.leginfo.ca.gov/pub/09-10/bill/sen/sb_0651-0700/sb_657_bill_20100930_chaptered.pdf'>http://www.leginfo.ca.gov/pub/09-10/bill/sen/sb_0651-0700/sb_657_bill_20100930_chaptered.pdf</a></p><p>Most nutritional supplements sold by Bodybuilding.com are manufactured in the U.S., in accordance with applicable U.S. labor laws. Some ingredients are sourced from foreign countries but U.S. manufacturers are required (per Good Manufacturing Practices outlined at 21 C.F.R. 111.260) to test ingredients for purity prior to use in nutritional supplements.</p><p>Bodybuilding.com is committed to conducting business in compliance with applicable law. Bodybuilding.com exhibits and promotes the highest standards of honest and ethical conduct in our dealings. Bodybuilding.com employees are expected to conduct themselves with honesty and integrity, and we recognize the important role manufacturers, ingredient suppliers and business partners play in helping us fulfill our commitment to ethical and responsible retailing.</p><p>Bodybuilding.com is a retailer not a manufacturer, but Bodybuilding.com is not aware of any unethical or illegal labor practices in connection with any ingredient sourced outside the U.S. We do not audit and assess each product manufacturer's sourcing practice. Bodybuilding.com is aware of the importance of ethical sourcing, and if Bodybuilding.com identifies a product manufacturer who does not meet Bodybuilding.com's expectations (including avoiding ingredients manufactured with trafficked labor), Bodybuilding.com will work with them to take corrective action or discontinue selling products manufactured by them.</p></li><li><h3>MOBILE SERVICES</h3> <p>The Site may include certain services that are available to you via your mobile phone or other mobile device if you have subscribed to them, including the ability to use your mobile device to place orders, receive and reply to messages from Bodybuilding.com, and access certain other features. Mobile devices and/or mobile apps may be subject to additional terms and conditions.</p></li><li><h3>DISCLAIMER AND LIMITATION OF LIABILITY</h3> <p>Bodybuilding.com provides the Site (including all Content) “as is” without warranty of any kind, whether express or implied. You are solely responsible for damage that results from the use of the Site including, but not limited to, damage to your computer system or loss of data.</p><p>BODYBUILDING.COM SPECIFICALLY DISCLAIMS ANY AND ALL WARRANTIES AND CONDITIONS OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, SECURITY, AND NON-INFRINGEMENT, AND ANY WARRANTIES ARISING OUT OF COURSE OF DEALING OR USAGE OF TRADE.</p><p>BODYBUILDING.COM SHALL NOT BE LIABLE TO YOU OR ANY OTHER PERSON OR ENTITY FOR DIRECT, INDIRECT, INCIDENTAL, SPECIAL OR CONSEQUENTIAL DAMAGES INCLUDING LOST PROFITS, PERSONAL INJURY (INCLUDING DEATH) AND PROPERTY DAMAGE OF ANY NATURE WHATSOEVER. IN NO EVENT SHALL OUR TOTAL LIABILITY TO YOU FOR ALL DAMAGES AND LOSSES FOR ANY CAUSE OF ACTION EXCEED THE AMOUNT PAID BY YOU, OR $100 (WHICHEVER IS LESS).</p></li><li><h3>HOLD HARMLESS AND INDEMNITY</h3> <p>To the maximum extent permitted by applicable law, you agree to hold harmless and indemnify Bodybuilding.com, its parent company, and their respective subsidiaries, affiliates, officers, agents, licensors, co-branders or other partners, and employees from and against any third-party claim arising from or in any way related to your use of the Site, including any liability or expense arising from all claims, losses, damages (actual and/or consequential), suits, judgments, litigation costs and attorneys' fees, of every kind and nature.</p></li><li><h3>DISPUTE RESOLUTION</h3> <p>By using the Site, you agree that all disputes, claims, or causes of action arising from or related to your use of the Site will be resolved through binding arbitration in Boise, Idaho in accordance with the rules of the American Arbitration Association. ARBITRATION OF A DISPUTE, CLAIM OR CAUSE OF ACTION SHALL BE IN AN INDIVIDUAL CAPACITY AND NOT AS A PLAINTIFF OR CLASS MEMBER IN ANY PURPORTED CLASS OR REPRESENTATIVE PROCEEDING.</p><p>These Terms of Use shall be construed in accordance with the laws of the state of Idaho, without giving effect to any choice or conflict of law provision. You agree to jurisdiction in Idaho and you will initiate any claim in connection with use of the Site or these Terms of Use in Ada County, Idaho.</p><p>Nothing in this Section shall prevent Bodybuilding.com from seeking injunctive or other equitable relief from the courts for matters related to data security, intellectual property, or unauthorized access to the Site.</p></li><li><h3>GENERAL TERMS</h3> <ol> <li>Entire Agreement/Severability. These Terms of Use, together with the App Terms, <a>Privacy Policy</a>, and <a>Conditions of Sale</a> and any amendments and any additional agreements you may enter into with Bodybuilding.com, shall constitute the entire agreement between you and Bodybuilding.com. If any provision of these Terms of Use is deemed invalid, that provision will be limited or eliminated to the minimum extent necessary, and the remaining provisions of these Terms of Use will remain in full force and effect.</li><li>No Waiver. No waiver of any term of these Terms of Use shall be deemed a further or continuing waiver of such term or any other term, and Bodybuilding.com's failure to assert any right or provision under these Terms of Use shall not constitute a waiver of such right or provision. </li><li>Defined Words. Any capitalized words used herein and not otherwise defined are defined in Bodybuilding.com's <a>Conditions of Sale</a>, App Terms, or <a>Privacy Policy</a>.</li></ol></li></ol>"
