                "block": "<p><small>Last modified on May 1, 2015.</small></p><p>Bodybuilding.com (UK) Ltd. and/or its parent companies, affiliates and subsidiaries ('BBcom UK') provide website features and other products and services to you when you visit or shop at Bodybuilding.com (the 'website'), use Bodybuilding.com products or services, use Bodybuilding.com applications for mobile, or use software provided by Bodybuilding.com in connection with any of the foregoing (collectively 'BBcom UK Services'). BBcom UK provides the BBcom UK Services and sells our products to you subject to the conditions set out on this page.</p><h2 >Conditions Of Use: EU (European Union)</h2> <p><b>Please read these conditions carefully before using BBcom UK Services. By using BBcom UK Services, you signify your agreement to be bound by these conditions.</b> We offer a wide range of BBcom UK Services, and sometimes additional terms may apply. When you use a BBcom UK Service (for example Gift Cards or BBcom UK applications for mobile), you will also be subject to the terms, guidelines and conditions applicable to that BBcom UK Service ('Service Terms'). If these Conditions of Use are inconsistent with the Service Terms, those Service Terms will control.</p><h2>A. Privacy</h2> <p>Please review our <a href='#privacy'>Privacy Notice</a> and <a href='#cookies'>Cookies &amp; Internet Advertising Policy</a>, which also govern your use of BBcom UK Services, to understand our practices.</p><h2>B. Electronic Communications</h2> <p>When you use any BBcom UK Service or send emails to us, you are communicating with us electronically. We will communicate with you by e-mail or by posting notices on the website or through the other BBcom UK Services. For contractual purposes, you consent to receive communications from us electronically and you agree that all agreements, notices, disclosures and other communications that we provide you electronically satisfy any legal requirement that such communications be in writing, unless mandatory applicable laws specifically require a different form of communication.</p><h2>C. Copyright, Authors' Rights and Database Rights</h2> <p>All content included in or made available through any BBcom UK Service, such as text, graphics, logos, button icons, images, audio clips, digital downloads and data compilations is the property of BBcom UK is used under license or belongs to content suppliers and is protected by international copyright, authors' rights and database right laws. The compilation of all content included in or made available through any BBcom UK Service is the exclusive property of BBcom UK, its licensors or content suppliers and is protected by international copyright and database right laws.</p><p>You may not extract and/or re-utilise parts of the content of any BBcom UK Service without our express written consent. In particular, you may not utilise any data mining, robots, or similar data gathering and extraction tools to extract (whether once or many times) for re-utilisation any substantial parts of the content of any BBcom UK Service, without our express written consent. You may not create and/or publish your own database that features substantial parts of a BBcom UK Service (e.g. our prices, product listings, videos and articles) without our express written consent. </p><h2>D. Trademarks</h2> <p>In addition graphics, logos, page headers, button icons, scripts, and service names included in or made available through any BBcom UK Service are trademarks or trade dress of BBcom UK and/or Bodybuilding.com, LLC. Bodybuilding.com's trademarks and trade dress may not be used in connection with any product or service that is not BBcom UK's, in any manner that is likely to cause confusion among customers or in any manner that disparages or discredits BBcom UK. All other trademarks not owned by BBcom UK that appear in any BBcom UK Service are the property of their respective owners, who may or may not be affiliated with, connected to, or sponsored by BBcom UK.</p><h2>E. Licence and Access</h2> <p>Subject to your compliance with these Conditions of Use and applicable Service Terms and your payment of any applicable fees, BBcom UK or its content providers grant you a limited, revocable, non-exclusive, non-transferable, non-sublicensable licence to access and make personal and non-commercial use of the BBcom UK Services. This license does not include any resale or commercial use of any BBcom UK Service or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of any BBcom UK Service or its contents; any downloading or copying of account information for the benefit of another merchant; or any use of data mining, robots, or similar data gathering and extraction tools.</p><p>All rights not expressly granted to you in these Conditions of Use or any Service Terms are reserved and retained by BBcom UK or its licensors, suppliers, publishers, rights holders, or other content providers. No BBcom UK Service, nor any part of any BBcom UK Service, may be reproduced, duplicated, copied, sold, resold, visited, or otherwise exploited for any commercial purpose without our express written consent. You may not frame or use framing techniques to enclose any trademark, logo or other proprietary information (including images, text, page layout, or form) without our express written consent. You may not use any meta tags or any other 'hidden text' utilizing BBcom UK's names or trademarks without our express written consent.</p><p>You may not misuse the BBcom UK Services. You may use the BBcom UK Services only as permitted by law. The licenses granted by BBcom UK terminate if you do not comply with these Conditions of Use or any Service Terms. </p><h2>F. Your BodySpace Account</h2> <p>If you use any BBcom UK Service you are responsible for maintaining the confidentiality of your account and password and for restricting access to your computer, and to the extent permitted by applicable law you agree to accept responsibility for all activities that occur under your account or password. You should take all necessary steps to ensure that the password is kept confidential and secure and should inform us immediately and change your password if you have any reason to believe that your password has become known to anyone else, or if the password is being, or is likely to be used in an unauthorised manner. You are responsible for ensuring that the details you provide us are correct and complete, and for informing us of any changes to the information you have provided. You can access and update much of the information you have provided us with, including your account settings, in the <a href='http://bodyspace.bodybuilding.com/'>BodySpace</a> area of the website.</p><p>You must not use any BBcom UK Service: (i) in any way that causes, or is likely to cause, any BBcom UK Service, or any access to it to be interrupted, damaged or impaired in any way, or (ii) for fraudulent purposes, or in connection with a criminal offense or other unlawful activity, or (iii) to cause annoyance, inconvenience or anxiety.</p><p>We reserve the right to refuse service, terminate accounts or remove or edit content if you are in breach of applicable laws, these Conditions of Use or any other applicable terms and conditions, guidelines or policies. </p><h2>G. Reviews, Comments, Communications, and Other Content</h2> <p>Visitors may post reviews, comments and other content; and submit suggestions, ideas, comments, questions or other information, as long as the content is not illegal, obscene, abusive, threatening, defamatory, invasive of privacy, infringing of intellectual property rights, or otherwise injurious to third parties or objectionable and does not consist of or contain software viruses, political/religious campaigning, commercial solicitation, chain letters, mass mailings or any form of 'spam'. You may not use a false e-mail address, impersonate