rder for a product at no cost any time before we send the Dispatch Confirmation E-mail relating to that product.</p><h2>B. Returns</h2> <p>Please review the <a>Returns</a> section in the Help section of the Store page which applies to products sold by BBcom UK.</p><p>BBcom UK does not take title to returned items until the items arrive at the returns address destination. At our discretion, a refund may be issued without requiring a return. In this situation, BBcom UK does not take title to the refunded item. </p><h2>C. Pricing and Availability</h2> <p>All prices are inclusive of legally applicable VAT.</p><p>We list availability information for products sold by us on the website including on each product information page. Beyond what we say on that page or otherwise on the website, we cannot be more specific about availability. As we process your order, we will inform you by e-mail as soon as possible if any products you order turn out to be unavailable, delayed or on back order if we cannot ship an item for some reason or you cancel the order, and you will not be charged for those products.</p><p>Please note that unless otherwise stated on the website, delivery estimates are just that. They are not guaranteed delivery times and should not be relied upon as such.</p><p>Despite our best efforts, a small number of the items in our catalogue may be mispriced. We will verify pricing when processing your order and before we take payment. If we have made a mistake and a product's correct price is higher than the price on the website, we may either contact you before shipping to request whether you want to buy the product at the correct price or cancel your order. If a product's correct price is lower than our stated price, we will charge the lower amount and send you the product. </p><h2>D. Product Information</h2> <p>Unless expressly indicated otherwise, BBcom UK is not the manufacturer of the products sold on this website. While we work to ensure that product informatio