li><li><a href='#notices'>Notices and Revisions</a></li><li><a href='#examples'>Examples of Information Collected</a></li></ul> <p id='controllers'>Controllers of Personal Information</p><p>Any personal information provided to or gathered by Bodybuilding.com is controlled by BBcom UK through Bodybuilding.com, LLC (the data controllers). BBcom UK is at Bodybuilding.com (UK) Ltd., Units 7 and 8 Foster Ave, Woodside Park, Dunstable, Bedfordshire, LU5 5TA, United Kingdom; and Bodybuilding.com, LLC is at 5777 N Meeker Ave, Boise, ID 83713, U.S.A.</p><p id='gather'>What Personal Information About Customers Does Bodybuilding.com Gather?</p><p>The information we learn from customers helps us personalize and continually improve your shopping experience at Bodybuilding.com. We use the information to handle orders, deliver products and services, process payments, communicate with you about orders, products, services and promotional offers, update our records and generally maintain your accounts with us, display content such as wish lists and customer reviews and recommend merchandise and services that might be of interest to you. We also use this information to improve our store and platform, prevent or detect fraud or abuses of our website and enable third parties to carry out technical, logistical or other functions on our behalf.</p><p>Here are the types of information we gather:</p><ul> <li><span>Information You Give Us:</span> We receive and store any information you enter on our website or give us in any other way. You can choose not to provide certain information but then you might not be able to take advantage of many of our features. We use the information that you provide for such purposes as responding to your requests, customizing future shopping for you, improving our stores, and communicating with you.<br></li><li><span>Automatic Information:</span> We receive and store certain types of information whenever you interact with us. For example, like many websites, we use 'cookies' and we obtain certain types of information when your Web browser accesses Bodybuilding.com or advertisements and other content served by or on behalf of Bodybuilding.com on other Web sites.<br></li><li><span>Mobile:</span> When you download or use apps created by BBcom UK or its subsidiaries and, where applicable, have requested or consented to location services, we may receive information about your location and your mobile device, including a unique identifier for your device. We may use this information to provide you with location-based services, such as search results, and other personalised content. Most mobile devices allow you to turn off location services.</li></ul> <br><p id='aboutcookie'>What About Cookies?</p><p>To enable our systems to recognize your device and to provide features to you, we use cookies. For more information about cookies and how we use them, please read our <a href='#cookies'>Cookies &amp; Internet Advertising policy</a>.</p><p id='share'>Does Bodybuilding.com Share the Information It Receives?</p><p>Information about our customers is an important part of our business and we are not in the business of selling it to others. Bodybuilding.com shares customer information only as described below and with Bodybuilding.com, LLC and the subsidiaries which Bodybuilding.com, LLC controls and that are either subject to this Privacy Notice or follow practices at least as protective as those described in this Privacy Notice.</p><ul> <li><span>Affiliated Businesses We Do Not Control:</span> We work closely with affiliated businesses. You can tell when a third party is involved in your transactions and we may share customer information related to those transactions with that third party.<br></li><li><span>Third Party Service Providers:</span> We employ other companies and individuals to perform functions on our behalf. Examples include fulfilling orders, delivering packages, sending postal mail and e-mail, removing repetitive information from customer lists, analysing data, providing marketing assistance, providing search results and links (including paid listings and links), processing credit card payments and providing customer service. They have access to personal information needed to perform their functions, but may not use it for other purposes. Further, they must process the personal information in accordance with this Privacy Notice and as permitted by applicable data protection laws.<br></li><li><span>Promotional Offers:</span> Sometimes we may send offers to selected groups of Bodybuilding.com customers on behalf of other businesses. When we do this, we do not give that business your name and address.<br></li><li><span>Business Transfers:</span> As we continue to develop our business, we might sell or buy subsidiaries or business units. In such transactions, customer information generally is one of the transferred business assets but remains subject to the promises made in any pre-existing Privacy Notice (unless, of course, the customer consents otherwise). Also, in the unlikely event that Bodybuilding.com, LLC or substantially all of its assets are acquired, customer information will of course be one of the transferred assets.<br></li><li><span>Protection of Bodybuilding.com and Others:</span> We release account and other personal information when we believe release is appropriate to comply with the law; enforce or apply our Conditions of Use and other agreements; or protect the rights, property or safety of Bodybuilding.com, our users or others. This includes exchanging information with other companies and organisations for fraud protection and credit risk reduction. Obviously, however, this does not include selling, renting, sharing or otherwise disclosing personally identifiable information from customers for commercial purposes in a way that is contrary to the commitments made in this Privacy Notice.<br></li><li><span>With Your Consent:</span> Other than as set out above, you will