rmation. This list will change as our website evolves.</p><p id='choices'>What Choices Do I Have?</p><ul> <li>As discussed above, you can always choose not to provide information, even though it might be needed to make a purchase or to take advantage of such Bodybuilding.com features as BodySpace, Customer Reviews and Forums.</li><li>You can add or update certain information on pages within the website.</li><li>If you do not want to receive e-mail or other mail from us, please be sure to opt out of these features. Even if you opt out of receiving notices regarding our <a href='#conditions'>Conditions of Use and Sale</a> and other legal notices from us, such as this Privacy Notice, those notices will still govern your use of Bodybuilding.com and orders placed with Bodybuilding.com, and it is your responsibility to review them for changes.</li><li>We may use personal information that we gather from you to allow third parties to personalize advertisements we display to you, when you allow us to do so.</li><li>The Help feature on most browsers will tell you how to prevent your browser from accepting new cookies, how to have the browser notify you when you receive a new cookie or how to disable cookies altogether. Additionally, you can disable or delete similar data used by browser add-ons, such as Flash cookies, by changing the add-on's settings or visiting the website of its manufacturer. However, because cookies allow you to take advantage of some of Bodybuilding.com's essential features, we recommend that you leave them turned on.</li></ul> <br><p id='children'>Are Children Allowed to Use Bodybuilding.com?</p><p>Bodybuilding.com does not sell products for purchase by children. If you are under 18, you may use Bodybuilding.com only with the involvement of a parent or guardian.</p><p id='notices'>Conditions of Use, Notices, and Revisions</p><p>If you have any concern about privacy at Bodybuilding.com, please e-mail us at <a href='mailto:legal@bodybuilding.com'>legal@bodybuilding.com</a> with a thorough description and we will try to resolve the issue for you.</p><p>Our business changes constantly and our Privacy Notice and the <a href='#conditions'>Conditions of Use and Sale</a> will change also. We may e-mail periodic reminders of our notices and conditions, unless you have instructed us not to, but you should check our website frequently to see recent changes. Unless stated otherwise, our current Privacy Notice applies to all information that we have about you and your account. We stand behind the promises we make, however, and will never materially change our policies and practices to make them less protective of customer information collected in the past without the consent of affected customers. </p><p>Related Practices and Information:</p><ul> <li><a href='#conditions'>Conditions of Use and Sale</a></li><li><a href='/store/email.htm'>Help Desk</a></li></ul> <br><p id='examples'>Examples of Information Collected</p><p></p><p>Information You Give Us:</p><p>You provide most such information when you search, buy, post, participate in a contest or questionnaire or communicate with customer service. For example, you provide information when you: search for a product; place an order through Bodybuilding.com or one of our third-party sellers; provide information in BodySpace (and you might have more than one if you have used more than one e-mail address when shopping with us) or your BodySpace; communicate with us by phone, e-mail or otherwise; complete a questionnaire or a contest entry form; use our services; participate in Forums or other community features; and provide and rate Reviews. As a result of those actions, you might supply us with such information as: your name; address and phone number; credit card information; people to whom purchases have been dispatched (including addresses and phone numbers); e-mail addresses of your friends and other people; content of reviews and e-mails to us; personal description and photograph in BodySpace; and financial information.</p><p>Automatic Information:</p><p>Examples of the information we might collect and analyse include: the Internet protocol (IP) address used to connect your computer to the Internet; login; e-mail address; password; computer and connection information such as browser type and version; and time zone setting, browser plug-in types and versions; operating system and platform; purchase history, which we sometimes aggregate with similar information from other customers to create features such as best sellers; the full Uniform Resource Locators (URL) clickstream to, through and from our website (including date and time); cookie number; products you viewed or searched for; and any phone number used to call our customer service number. We may also use browser data such as cookies, Flash cookies (also known as Flash Local Shared Objects), or similar data on certain parts of our website for fraud prevention and other purposes. During some visits we may use software tools such as JavaScript to measure and collect session information, including page response times, download errors, length of visits to certain pages, page interaction information (such as scrolling, clicks, and mouse-overs), and methods used to browse away from the page. We may also collect technical information to help us identify your device for fraud prevention and diagnostic purposes.</p><p>Mobile:</p><p>Most mobile devices provide users with the ability to disable location services. Most likely, these controls are located in the device's settings menu. If you have questions about how to disable your device's location services, we recommend you contact your mobile service carrier or your device manufacturer.</p><p>Email Communication:</p><p>We collect emails from customers/visitors for the purpose of email promotion from several sources on our website, including when a new customer places an order. The email information is stored in a marketing email system. All of these email communications provide the ability for you to opt out of future email communications through an 'Unsubscribe' link at the bottom of these emails. Placing a second order does not change your previous choice for receipt of promotional emails. You may sign up to receive promotional emails through '<a href='https://www.bodybuilding.com/fun/emailSignup-deals.html'>Discounts and Deals</a>' on our site. If you sign up to enter a sweepstakes or contest, you are opted in to receive email communications. If you sign up to receive 'weekly trainer' emails, you are opted in to receive promotional emails. When submitting your information for these purposes, you will see the following message: 'By submitting your email you are agreeing to receive promotional emails from Bodybuilding.com. You may opt out at any time.' We do not sell your email or other contact information to third parties.</p><p>Information From Other Sources:</p><p>Examples of information we might receive from other sources include: updated delivery and address information from our carriers or other third parties, which we use to correct our records and deliver your next purchase or communication more easily; account information, purchase or redemption information and page-view information from some merchants with which we operate co-branded businesses or for which we provide technical, fulfillment, advertising or other services; search results and links, including paid listings (such as Sponsored Links); and credit history information from credit bureaus, which we use to help prevent and detect fraud and to offer certain credit or financial services to some customers.</p><p>Co-Branded and Joint Offerings:</p><p>We may from time to time offer joint or co-branded content, products and services.</p><p>Information You Can Access:</p><p>Examples of information you can access easily at Bodybuilding.com include: up-to-date information regarding recent orders; personally identifiable information (including name, e-mail, password, communications and personalised advertising preferences); payment settings (including credit-card information and gift certificate, gift card and cheque balances); e-mail notification settings; and Your Profile (including your product reviews and personal profile).</p><h2 class='article-sub-header' id='cookies'>Cookies &amp; Internet Advertising</h2> <p><span>Visiting BBcom UK's websites with your browser settings adjusted to accept cookies or using Bodybuilding.com devices, mobile apps, or other software tells us that you want to use BBcom UK's products and services and that you consent to our use of cookies and other technologies to provide them to you as described in this notice and in our <a href='#privacy'>Privacy Notice</a>.</span> See below for information on how to modify the settings in your device to notify you when you receive a new cookie and disable cookies altogether.</p><p>Cookies and How We Use Them</p><p>Cookies are unique identifiers that we transfer to your device to enable our systems to recognise your device and to provide features to you. Any reference to 'sites' of BBcom UK includes our Bodybuilding.com websites, devices, mobile apps or other software. For information on the controllers of your personal information, see <a href='#controllers'>Controller of Personal Information</a> in our Privacy Notice.</p><p>We also use cookies for additional purposes, including:</p><ul> <li>Identifying you when you sign-in to our site. This allows us to provide you with product recommendations, display personalised content, and recognise you as a BodySpace member, among other customised features and services we provide.</li><li>Delivering content, including advertisements, relevant to your interests on BBcom UK sites and third-party sites. Our interest-based ads are subject to your preferences as described in the next section.</li><li>Keeping track of your specified preferences. This allows us to honour your likes and dislikes, such as whether or not you would like to see interest-based ads. You may generally exercise your preferences through your BodySpace account.</li><li>Keeping track of items stored in your shopping basket.</li><li>Conducting research and diagnostics to improve Bodybuilding.com's content, products and services.</li><li>Preventing fraudulent activities.</li><li>Improving security.</li></ul> <br><p>Cookies allow you to take advantage of some of Bodybuilding.com's essential features.</p><p>Cookies and Browser Settings</p><p>The Help feature on most browsers will tell you how to prevent your browser from accepting new cookies, how to have the browser notify you when you receive a new cookie and how to disable cookies altogether. Additionally, you can disable or delete similar data used by browser add-ons, such as Flash cookies, by changing the add-on's settings or visiting the website of its manufacturer.</p><p>Internet Advertising</p><p>On BBcom UK-owned and operated sites and unaffiliated sites, BBcom UK displays interest-based advertising using information you make available to us when you interact with our sites, content, or services. Interest-based ads, also sometimes referred to as personalised or targeted ads, are displayed to you based on information from activities such as purchasing on our sites, use of devices, apps or software, visiting sites that contain BBcom UK content or ads, interacting with BBcom UK tools or using our payment services.</p><p>Like other online ad networks, we use cookies, web beacons (also known as action tags or single-pixel gifs), and other technologies (collectively, 'cookies'). Cookies enable us to learn about what ads you see, what ads you click, and other actions you take on our sites and other sites. This allows us to provide you with more useful and relevant ads. For example, if we know what ads you are shown we can be careful not to show you the same ones repeatedly.</p><p>We do not associate your interaction with unaffiliated sites with 