e discussed below.</p><h2>4. EXPERIENCE OR PREFERENCE COOKIES</h2><p><span>(Example: language setting cookies; RTP Cookies – customizing content)</span></p><p>These cookies collect information about your choices and preferences (e.g. username and language selection) and are used to enable certain additional functionality on our websites, such as storing your preferences. This functionality improves user experience and allows us to customize your site experience accordingly. </p><h2>5. SOCIAL MEDIA AND ADVERTISING COOKIES</h2><p><span>(Examples: Facebook/Google Plus using social media for behavioral advertising, analytics, advertising and market research; AdRoll)</span></p><p>Social media cookies collect information about social media usage and allow you to connect to your social networks to share content from our website or mobile apps.</p><p>We may also use advertising cookies to market Bodybuilding.com products or services to you on third party websites. For example, if you visit our website, you may then see an advertisement for Bodybuilding.com products or services on certain third-party websites you visit in the future. Information about this is described under the paragraphs in our Privacy Policy entitled “Service Providers” and “Third Party Partners &amp; Integrations.”</p><p>We sometimes use cookies delivered by third parties to track the performance of our advertisements. For example, these cookies remember which browsers have visited our websites. The information provided to third parties does not include personal information, but this information may be re-associated with personal information after we receive it. This process helps us manage and track the effectiveness of our marketing efforts.</p><p>We also contract with third-party advertising networks that may collect IP addresses and other information from web beacons on our websites, emails, and on third-party websites. Ad networks follow your online activities over time by collecting website navigational information through automated means, including through the use of cookies. They use this information to provide advertisements about products and services that may be of interest to you. You may see these advertisements on other websites. This process also helps us manage and track the effectiveness of our marketing efforts and ensure you receive a personalized experience.</p><h2>6. ANALYTICS COOKIES</h2><p><span>(Example of third party cookie: Optimizely/Google Analytics)</span></p><p>Analytics cookies collect information about your use of the Bodybuilding.com Platforms, and enable us to improve the way it works. For example, analytics cookies show us which are the most frequently visited pages on our website or mobile apps, help us record any difficulties you have (e.g., mobile app crashes), and show us whether our advertising is effective or not. This allows us to see the overall patterns of usage on the Platforms, rather than the usage of a single person. We use the information to analyze Bodybuilding.com Platforms’ traffic to help create a better user experience. Analytics cookies may be classified as either functional, experience/preference, or social media/advertising cookies.</p><h2>7. HOW DO I MANAGE COOKIES?</h2><p>If you'd like to remove or disable cookies via your browser, you certainly can. You'll want to refer to your browser's configuration documentation (usually the Help portion of your browser’s toolbar) to do this since the steps for doing so are usually browser-specific. </p><p>Flash cookies operate differently than browser cookies, and cookie management tools available in a web browser will not remove flash cookies. To learn more about how to manage flash cookies, you can visit the Adobe website and make changes at the Global Privacy Settings Panel. </p>Your mobile device may allow you to control cookies through its settings function. Refer to your device manufacturer’s instructions/settings panel for more information. <p>For customers located in the EEA, you may adjust your Cookie Settings at any time by taking the following actions:</p><ul> <li>If you are accessing our site via a desktop browser, you can adjust your Cookie Settings by clicking the “Cookie Settings” link in the site footer below.</li><li>If you are accessing our site via a mobile app, or using any of Bodybuilding.com’s various mobile applications, you may access and adjust your Cookie Settings in the “Settings” menu in the mobile application.</li></ul><p>One important note is that if you do go this route, this might adversely impact your ability to use our services effectively. Enabling cookies ensures a smoother experience when you use our site or mobile apps.</p>"
