    $(document).on('click', '.helpSectionNormalBox', function (e) { //SET CLICK ZONES FOR CLICKABLE BOXES
        e = e || window.event;
        e.stopImmediatePropagation();
        var parent,
            text = e.currentTarget.textContent.toLowerCase();
        if (window.location.search.indexOf('&') >= 0) {
            parent = window.location.search.split('&')[0];
            searching(text);
//            contactData(e.currentTarget.textContent, parent);
