        } else {
            searching(text);
//            contactData(text, "");
        }
        return;
    });
    $(document).on('click', '.help__quick__links a, .help__side__bar ul li', function (e) {
        e = e || window.event;
        if (e.target.href.length === 0) {
            searching(e.currentTarget.textContent.toLowerCase());
//            contactData("", e.currentTarget.textContent);
        }
    });
    $(document).on('click', '.help__answer__box a', function (e) { //CLICKING ON ANCHORS INSIDE ANSWERS
        e = e || window.event;
        e.preventDefault();
        if (e.currentTarget.href.length >= 1) {
            if (e.currentTarget.href.type === 'email') {
                window.location = e.currentTarget.href;
            } else {
                window.open(e.currentTarget.href, '_self');
            }
        } else {
            searching($(this).text().toLowerCase());
        }
    });
    $(document).on('click', '.help__break__link', function (e) { //BREADCRUMB CLICKS
        e = e || window.event;
        searching($(this).text());
    });
    searchBar.addEventListener('keyup', function () {
        //SEARCH BAR TYPING
        //ON ANY KEY UP SET TIMER TO SEE IF USER IS DONE TYPING AND THEN SEARCH FOR WHAT IS IN THE SEARCH BOX
        clearTimeout(typingTimer);
        //IF SEARCH FIELD IS EMPTY AFTER TYPING THEN RESET HELP PAGE
        if (searchBar.value.length === 0) {
            reset();
            return;
        }
        //IF SEARCH FIELD HAS MORE THAN 4 CHARACTERS RUN SEARCH - PREVENTS TOO MANY ENTRIES FROM SHOWING
        if (searchBar.value.length >= 4) {
            typingTimer = setTimeout(function () {
                searching(searchBar.value, true);
//                helpContactData.searchBarTerm = searchBar.value;
            }, 550);
        }
    });
    searchBar.addEventListener('keydown', function () {
        //ON ANY KEY DOWN RESET TIMER ABOVE
        clearTimeout(typingTimer);
    });
    for (i = 0; i < resetElements.length; i += 1) {
        //ADD CLICK EVENTS TO RESET TO ALL WITH help__reset__buttons CLASS
        resetElements[i].addEventListener("click", function () {
            reset();
        });
    }
    window.onpopstate = function (event) { //BACK AND FORWARD BUTTONS
        event.preventDefault(); //PREVENT ACTUALLY GOING BACK AND FORTH
        var popL = popu.length;
        if (popL === 3) { //IF BOTH FIRST AND SECOND TOPIC ARE IN ARRAY THEN SEARCH FOR 1ST TOPIC CELLS AS BACK HAS BEEN PRESSED
            searching(popu[1].replace(/-/g, ' ')); //SEARCH FOR FIRST LEVEL TERM AND DISPLAY FIRST LEVEL CELLS
        } else if (popL === 2) { //IF ONLY FIRST TOPIC IS IN ARRAY RESET AS BACK HAS BEEN PRESSED FROM 1ST LEVEL CELLS
            reset(); //RESET PAGE TO DEFAULT STATE
        }
    };
    if (loggedIn()) { //ADDS CUSTOMERS NAME TO THE HEADER OF THE PAGE IF THEY ARE LOGGED IN AND HAVE A NAME SET
        var name = JSON.parse(localStorage.currentUser).user.realName, //GET REAL NAME FROM LOCAL STORAGE
            firstName = name.trim().split(" ")[0]; //GET NAME AFTER FIRST SPACE - FIRST NAME
        if (firstName.length > 0) {
            document.querySelector('.help__page__header').textContent = "Hello, " + firstName + ". How can we help you?";
        }
    }
    //KEEPS HEADER STICKY AT TOP OF WINDOW IN MOBILE
    if (window.innerWidth <= 1000) {
        var initialAtTop = $('.help__content__header__container').offset().top + $('.help__content__header__container').height();
        $(window).scroll(function () {
            var atTop = $(window).scrollTop();
            if (atTop >= initialAtTop) {
                contentHeaderContainer.classList.add('headerFixed');
            } else if (atTop) {
                contentHeaderContainer.classList.remove('headerFixed');
            }
        });
    }
});

